import React from "react";
import "./education.css";


function Education() {
  return (
    <div className="card">
      <img
        src="https://via.placeholder.com/150"
        alt="Avatar"
        style={{ width: '100%' }}
      />
      <div className="container">
        <h4 className="title">
          <p className="institution">Universidad Técnica Nacional</p>
          <b>Bachillerato Gestión y Administración Empresarial</b>
        </h4>
        <p className="institution">CTP Ricardo Castro Beerl</p>
        <p className="degree"> Técnico en Secretariado Ejecutivo</p>
      </div>
    </div>
  );
}

export default Education;
